import NameForm from './components/NameForm';


class App extends React.Component {

  state= {
    questions: data
  }

  render() {

    return (
      <div className="container">
        <div className="row">
          <div className="col-md-6 offset-3 main-app">
            <Header />
            <hr />
            <QuizQuestion />
            <QuizQuestion />
            <QuizQuestion />
            <QuizQuestion />
            <NameForm />
          </div>
        </div>
      </div>
    );
  }
}

export default App;
